#Accepted on Leetcode
#Find the length of longest substring without repeating characters
# Loop for the string s, and use a list called temp to save the characters that are
# in a continuous non-repeated sub-string.
# If character s[i] not in temp, then add it to temp.
# If character s[i] in temp, update result if the length of temp is greater than result
# (who records the longest sub-string length). Then delete from temp the characters that are in front of s[i],
# and add s[i] to tail of temp.
# Loop to end of s, return result.
#https://leetcode.com/discuss/101489/very-easy-python-solution-in-o-n-time
class Solution(object):
    def lengthOfLongestSubstring(self,s):
        mylist = [] #this list has characters of s which are not same but are consecutive
        maxlen =0
        for i in xrange(len(s)):
            if s[i] in mylist: #if its in list, I want to update my maxlen if list length is greater than maxlen so far
                if len(mylist[:mylist.index(s[i])]) > maxlen:
                    maxlen = len(mylist[:mylist.index(s[i])]) #because we are changing list, we need to check if the number of elements we are going to remove are more than the maxlen or not.
                mylist = mylist[mylist.index(s[i])+1:] #what if s[i] is the last element in the list? It will return empty list
                mylist.append(s[i]) # need to add this at the end

            else:
                mylist.append(s[i])
                maxlen = max(maxlen, len(mylist))
        return maxlen
